%[text] # figureの作成
%[text] 脳波の波形を描いていきます。
%[text] dataは(ch,time,epoch,freq,prt); の構造です。
%[text] 練習として，参加者一人目，1010条件，１epoch目，1チャンネルの波形を書いていきます。
%[text] つまり，prt=1, freq=1, epoch=1, ch=1の波形
figure %[output:90de182a]
plot(data(1,:,1,1,1)) %[output:90de182a]
%[text] % ↑これでもよいが横軸と縦軸を脳波研究で慣習的な表示に変更していきます。
%[text] 横軸（時間軸）は0から800となっていますが，100msのベースラインを切り出しているので，-100から開始したい。
%[text] 縦軸（amplitude）は脳波では上が負（-），下が正(+)なので符号を逆にしたい。
%%
%[text] ## 関数の説明 plot -\> 線形 2 次元プロット
%[text] 
%[text] Yのサイズが1000\*1の場合，
%[text] plot(Y)とすると，ｘの値は，1～1000の値とそれに対応するＹの値の 2 次元のライン プロットを作成します。
%[text] 
%[text] 一方，plot(X,Y) とも書けて、X の値に対応する Y のデータの 2 次元ライン プロットを作成します。
%[text] ただし，XとYは同じ長さでなければなりません。
%%
%[text] ## 関数の説明 linspace -\> 線形に等間隔なベクトルを作成
% y = linspace(x1,x2) は、x1 ～ x2 の間の等間隔の点を 100 個含む行ベクトルを返します。
y1 = linspace(-0.1,0.7);
% y = linspace(x1,x2,n) は、n 個の点を出力します。点の間隔は (x2-x1)/(n-1) です。
y2 = linspace(-0.1,0.7,1000);
%[text] これを踏まえて以下の様にplotしていきます
%%
%[text] ## linspaceを使ってfigureの作成
%[text] 参加者一人目，1010条件，１epoch目，1チャンネルの波形なので，
%[text] prt=1, freq=1, epoch=1, ch=1
fs = 1000; % サンプリング周波数
N=size(data,2); % データ長

x=linspace(-0.1,(N-100)/fs,N);
y=data(1,:,1,1,1); % (ch,time,epoch,freq,prt); 
figure %[output:383ab6a6]
plot(x,y,'r','LineWidth',2); % 'r'は赤い色の指定，'LineWidth'は線の太さを指定 %[output:383ab6a6]
axis('ij') % y 値のプラスマイナスを逆にします。 %[output:383ab6a6]
